const list = [
  {
    title: "Portugal",
    content: "Continente Europeu"
  },
  {
    title: "Espanha",
    content: "Continente Europeu"
  },
  {
    title: "USA",
    content: "Continente Americano"
  },
  {
    title: "Angola",
    content: "Continente Africano"
  },
  {
    title: "India",
    content: "Continente Asiático"
  }
];

export default list;
